import React from 'react';
import './SideToolbar.css';

function SideToolbar({ onBrightnessChange, onContrastChange, onSave }) {
    return (
        <div className="side-toolbar">
            <div>
                <label htmlFor="brightness">Brightness:</label>
                <input type="range" id="brightness" min="-100" max="100" defaultValue="0" onChange={onBrightnessChange} />
            </div>
            <div>
                <label htmlFor="contrast">Contrast:</label>
                <input type="range" id="contrast" min="-100" max="100" defaultValue="0" onChange={onContrastChange} />
            </div>
            <button onClick={onSave}>Save</button>
        </div>
    );
}

export default SideToolbar;
